/*eslint max-len: ["error", { "code": 150 }]*/

import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import PropTypes from 'prop-types';
import base from '../../config/api.js';
let api = base.api();


class View extends Component {
    static propTypes = {
        match: PropTypes.object.isRequired,
        location: PropTypes.object.isRequired,
        history: PropTypes.object.isRequired
    };
    constructor(props) {
        super(props);
        this.getContent = this.getContent.bind(this);
        this.state = {
            p: this.props.match.params.data,
            data: [],
            title: "All"
        };
    }

    componentDidMount() {
        this.getContent();
    }

    getContent() {
        let that = this;
        fetch(api + `/data/`)
            .then(res => res.json())
            .then(function (res) {
                res.map(function (item) {
                    that.state.data.push(<p>{ item.ip }</p>)
                });
                return true
            });
    }
    render() {
        return (
            <main>
                <nav className="navbar_main under">
                    <ul>
                        <li><NavLink to="/view/data" activeClassName="selected">All</NavLink></li>
                    </ul>
                </nav>
                <div>
                    { this.state.data }
                </div>
            </main>
        );
    }
}

export default View;
